INSERT INTO `reviews` (`id`, `title`, `review`, `date`, `userId`, `type`, `directionId`, `countryId`, `regionId`, `subregionId`, `cityId`, `hotelId`, `views`, `useful`, `useless`, `spam`, `unbeleive`, `been`, `spent`, `about`, `slider1`, `slider2`, `slider3`, `slider4`, `recommend`, `return`, `general`, `sights`, `impressions`, `attractions`, `approaches`, `objectTitle`, `objectType`, `moderated`) VALUES
(1, 'Тест', 'Текст тестового отзыва', '2011-07-21', 1, 'c', 5, 1, 1, 1, 1, 0, 0, 0, 0, 1, 0, '2011-07-04', 't', 'd,r', 1, 0, 11, 0, 0, 13, '5', '5', '4', '4', '1', '', 'p', 1),
(2, '4 незабываемых дня в Париже', 'В конце октября мы с моей невестой провели 4 незабываемых дня в Париже. Конечно, впечатление от отеля во многом формирует общее впечатление от отдыха, и нам в этом плане повезло, отель был прекрасен. Весь новенький (думаю, совсем недавно проводился ремогт) Ares Eiffel ждал нас на тихой и уютной улочке, что большая редкость в этом районе Парижа. Правда, рекомендую перед приездом посмотреть его расположение на гугл мэпс, а то нам с таксистом пришлось немного покружиться. Несмотря на проволочки в дороге, мы приехали часа за полтора до check-ina, но нам тут же открыли номер. Вообще,персонал вотеле оказался очень и очень приятный, у всех прекрасный английский, а у владельца такая фишка - он почти каждый день бывает в отеле и подходит к посетителям знакомиться, узнаёт, всё ли в порядке, мелочь, конечно, но атмосфера Парижа именно из таких мелочей состоит. Месторасположение у Ares Eiffel прекрасное, вокруг несколько кафе, кстати, не очень дешевых, поэтому лучше сходить в супермаркет по соседству (Le Marche Franprix), где еда прекрасна так же, как и цены. Устраивать пикники в номере с видм на Эйфелеву башню (донеё пешком 10 минут) очень даже приятно. Ещё неподалёку хороший дисконт-магазин. Погороду удобно и даже приятно (да-да!) перемещаться на метро, и до станции La Motte-Picquet – Grenelle от отеля буквально два шага. Питание в отеле воображения непоражает, у нас был только завтрак, и это был самый обычный скромный континентальный завтрак. Кофе-машины почему-то вообще нет, не знаю, может,сейчас они её (их) уже закупили. Номер нам понравилась, не сказать чтобы очень просторно, но и локтями друг одруга не задевали. Интерьер симпатичный, всё чисто, убрано, хороший вид из, окна, ванная только маловата да и кровати, наверное, бывают помягче; отопление, кондишн, горячая-холодная вода - всё работало бесперебойно, через стены только иногда было слышно "звуки" соседей, вообще довольно шумных. В общем, это был отличный отдых в очень приятном отел